import React from 'react';


const Rank = ({name, entries}) => {

	return (
		<div>
			{`${name} , your current rank is...`}
		      <div className='white f1 '>
		        {entries}
		      </div>
			<div className='white f3'>
				{'Hi, your current rank is ...'}
			</div>
			<div className='white f1'>
				{'No.5'}
			</div>
		</div>	
	);
}

export default Rank;
